import React from 'react';
import Input from '../../components/Input/Input';
import Textarea from '../../components/textarea/Textarea';
import Radio from '../../components/radiobutton/Radio';

const Form = () => {
  const handleProgressChange = (e) => {
    console.log(e.target.value);
  };
  return (
    <div>
       <Input placeholder="Todo list Tile" inputId="todoInput" type="text"/>
      <Input placeholder="Created By" inputId="createdByInput" type="text" />
      <Input placeholder="Deadline" inputId="deadlineInput" type="date" />
      <Radio name="progress" value="finished" label="Finished" checked={true} onChange={handleProgressChange} />
      <Radio name="progress" value="ongoing" label="On Going" checked={false} onChange={handleProgressChange} />
      <Radio name="progress" value="goodToGo" label="Good to Go" checked={false} onChange={handleProgressChange} />
      <Textarea placeholder="Description" id="textarea" rows="4" cols="50"/>
    </div>
  );
};

export default Form;
